Hej  !!! 
     Det är dags att sälja Opel Movano, då den inte längre används !!! 
     Fungerar bra i motor och växellåda !!! 
     Besiktning till 2025.12.31 !!!
     OBS !!!  Motorn i bilen är bytt, motorn är tagen från en 2007 Renault Trafic med 103 000 km., som hade problem med elektronik och automatlåda (robot), som gick till reservdelar (finns bevis och anteckning i serviceboken !!!).  
     Körkort kategori B !!!
     Före besiktningen byttes följande ut:
   - ny vindruta; 
   - motorolja och alla filter; 
   - ny kamrem; 
   - främre och bakre bromsbelägg; 
   - två främre hjullager;
   - framed tvåspindelled;
   - vänster allt nya drivaxel; 
   - kabel och nya handbromsbelägg med reparationssats; 
   - två bakre bromsok;
    - två främre kullager. 
     Bilen har: 
   - original servicebok; 
   - två nycklar;  
   - kruka och Wabasto; 
   - salon är ren, inte förstörd !!! 
     Mått på kenneln: 4,10 × 2,10 × 2,20, bakgavellyften fungerar bra, inga klagomål !!! 
     Erbjud inte byten, kontakta endast seriösa köpare, för att inte slösa varken deras tid eller din !!! Mvh.
